import React from "react";
import { generateId, getRandomImage } from "../utils/utils";
import CreateDate from "./CreateDate";
import ProfilesList from './ProfilesList';

const images = [
  "https://i49.vbox7.com/i/0f7/0f79cb2e6.jpg",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://www.ramania-bg.com/uploads/monthly_2021_03/154813048_276653637155820_6514378032190224327_o.jpg.8ca94e5cf5968a370352e305613fbc48.jpg",
  "data:image/jpeg;base64,",
  "https://lyricstranslate.com/files/styles/large/public/IMG_201911333_084218.jpg?itok=tT4zFunG",
  "https://yt3.ggpht.com/ytc/AAUvwnh2Y4Yyyr-RPyqZQR0H41_RA0uhkwjEmXQJIEsFiQ=s900-c-k-c0x00ffffff-no-rj",
  "https://i.ytimg.com/vi/rEcdN6QhpUI/maxresdefault.jpg",
  "https://hotarena.net/userfiles/content/27739/original/potres-skandalnata-studentka-mis-tigrova-mina-vsichki-granici-razkrachi-se-bez-belio-v-neta-snimka-za-vazrastni-1.jpg",
  "https://i.ytimg.com/vi/njb2LvxiKHU/maxresdefault.jpg",
  "data:image/jpeg;base64,",
];

class TinderDate extends React.Component {
  // Class properties
  state = {
    allProfiles: [],
  };

  napraviOvca = (value) => {
    let newUser = {
      name: value,
      image: getRandomImage(images),
      id: generateId(),
    };

    this.setState({
      allProfiles: [...this.state.allProfiles, newUser],
    });
  };

  mahniGo = (id) => {
    let filteredProfiles = this.state.allProfiles.filter(
      (user) => user.id !== id
    );

    this.setState({
      allProfiles: filteredProfiles,
    });
  };

  render() {
    console.log(this.state);
    return (
      <div>
        <h2>Dobavi Profoile</h2>
        <CreateDate onCreate={this.napraviOvca} />

        <ProfilesList profiles={this.state.allProfiles} onDelete={this.mahniGo}/>
      </div>
    );
  }
}

export default TinderDate;
